import React from 'react'
import "./Footer.css";
import SongPlayer from "./SongPlayer.js";
function Footer(trackUri,accessToken) {

    return (
        <div className = "footer">
           <SongPlayer accessToken = {accessToken} trackUri = {trackUri}/>
        </div>
    )
}

export default Footer
